import { container, title } from "../../assets/jss/material-kit-react.js";
import {containerFluid} from "../../assets/jss/material-kit-react";

const createMnemonicStyle = {
    container: {
        ...container,
        width: "auto",
        marginTop:"100px",
        marginLeft:"28px",
        color: "#FFFFFF",
        overflow: "hidden",
        position: "relative",
        display: "flex",
        alignItems: "center",
    },

    box_container: {
        ...containerFluid,
        "@media (min-width: 176px)": {
            maxWidth: "140px",
        },
        "@media (min-width: 168px)": {
            maxWidth: "120px",
        },
        "@media (min-width: 192px)": {
            maxWidth: "160px",
        },
        "@media (min-width: 200px)": {
            maxWidth: "140px",
        },
    },
};

export default createMnemonicStyle;
